// SPDX-License-Identifier: MIT
pragma solidity ^0.8.11;

import "../node_modules/@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC721/extensions/ERC721Enumerable.sol";
import "../node_modules/@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "../node_modules/@openzeppelin/contracts/access/Ownable.sol";
import "../node_modules/@openzeppelin/contracts/utils/Counters.sol";
import "../node_modules/@openzeppelin/contracts/utils/math/SafeMath.sol";
import "../node_modules/@openzeppelin/contracts/utils/Strings.sol";

import "./Utils.sol";

/// TREBAM DA VRATIM FAJLOVE CONTRACTOVA KOJE SAM PRIVREMENO SKLONIO DOK SAM DEBAGOVAO, NALAZE SE U NFT PROJECT FOLERU!!!

contract CityBuilders is ERC721, ERC721Enumerable, ERC721URIStorage, Ownable, Utils {
    using Counters for Counters.Counter;
    using SafeMath for uint256;

    Counters.Counter private _tokenIdCounter;

    constructor() ERC721("CityBuilders", "CTB") {}

    uint mintingPrice = 0.1 ether;
    bool saleIsActive = false;
    uint maxMintTokens = 10;
    uint MAX_CITIES = 10000;

    mapping(uint => City) cities;
    uint128 startingMoney = 100000;

    function _baseURI() internal pure override returns (string memory) {
        return "http://localhost:3000/cities";
    }

    function safeMint(uint numOfTokens) public payable {
        require(saleIsActive, "Sale must be active to mint a City NFT");
        require(numOfTokens <= maxMintTokens, "Can only mint 10 tokens at a time");
        require(totalSupply().add(numOfTokens) <= MAX_CITIES, "Purchase would exceed max number of City NFTs");
        require(mintingPrice.mul(numOfTokens) <= msg.value, "Ether value sent is not correct");

        uint256 tokenId = _tokenIdCounter.current();
        _tokenIdCounter.increment();

        generateRandomBuildings(cities[tokenId].buildingList);
        cities[tokenId].money = startingMoney;
        cities[tokenId].income = calculateIncome(cities[tokenId].buildingList);
        cities[tokenId].owner = msg.sender;

        _safeMint(msg.sender, tokenId);
        _setTokenURI(tokenId, Strings.toString(tokenId)); // sets the tokenUri to "_baseURI/tokenId"
    }

    // The following modifier is used to check if a user owns the NFT which he wants to change.
    modifier ownsNFT(uint tokenId) {
        require(cities[tokenId].owner == msg.sender, 'The caller of the function does not own the nft');
        _;
    }

    // The following functions are overrides required by Solidity.
    function _beforeTokenTransfer(address from, address to, uint256 tokenId) internal override(ERC721, ERC721Enumerable) {
        super._beforeTokenTransfer(from, to, tokenId);
    }

    function _burn(uint256 tokenId) internal override(ERC721, ERC721URIStorage) {
        super._burn(tokenId);
    }

    function tokenURI(uint256 tokenId) public view override(ERC721, ERC721URIStorage) returns (string memory) {
        return super.tokenURI(tokenId);
    }

    function supportsInterface(bytes4 interfaceId) public view override(ERC721, ERC721Enumerable) returns (bool) {
        return super.supportsInterface(interfaceId);
    }

    // THe following  function is called to start the sale and to end it if all items are sold out or if a problem occurs.
    function flipSaleState() public onlyOwner {
        saleIsActive = !saleIsActive;
    }
}
